@new.route('/books')
def book():
    books=[{'name':'book1','author':'saj1','cover':'data:image/jpeg;base64,'},{'name':'book2','author':'saj2','cover':'data:image/jpeg;base64,'},{'name':'book3','author':'saj3','cover':'data:image/jpeg;base64,'}]
    return render_template('book.html',books=books)

new.run(debug=True)